// Fichier worker minimal pour PDF.js
// Ce fichier ne fait rien mais évite l'erreur "No worker specified"
// Normalement, on utiliserait le worker officiel de PDF.js

self.onmessage = (event) => {
  // Répondre aux messages avec un statut indiquant que nous ne pouvons pas traiter les demandes
  self.postMessage({
    action: "error",
    error: "PDF worker not fully implemented",
    data: null
  });
};
